<?php

# @autogenerated
declare(strict_types=1);

namespace Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ValueObject\Accesor;

use Civi\Lughauth\Features\Access\ApiKeyClient\Domain\ValueObject\ApiKeyClientEnabledVO;

trait ApiKeyClientEnabledAccesor
{
    private ApiKeyClientEnabledVO $_enabled;
    public function getEnabled(): bool
    {
        return $this->_enabled->value();
    }
    public function enabled(): ApiKeyClientEnabledVO
    {
        return $this->_enabled;
    }
    public function isEnabledChanged(?self $original = null): bool
    {
        return $this->_enabled->value() !== ($original ? $original->_enabled->value() : null);
    }
    public function withEnabled(ApiKeyClientEnabledVO|bool $enabled): self
    {
        $copy = clone $this;
        $copy->_enabled = ApiKeyClientEnabledVO::from($enabled);
        return $copy;
    }
}
